Lego Marvel X-Men: X-Mansion 76294
Yetişkin hayranlar için LEGO® Marvel X-Men: X-Mansion (76294) seti, Xavier Yüksek Öğrenim Enstitüsü'nün detaylı bir modelidir. Bu inşa edilebilen model, süper kahraman maceralarının yetişkin hayranları için ideal bir hediyedir. 2 katlı, 3093 parçalı X-Men X-Mansion’ın genişliği 40 cm’dir ve inşa edilebilen bir Sentinel figürü ile 10 X-Men minifigürü içerir: Profesör X, Wolverine, Jean Grey, Cyclops, Storm, Gambit, Rogue, Iceman, Bishop ve Magneto. Üst katta Profesör X'in laboratuvarı, Wolverine'in yatak odası ve bir tıbbi laboratuvar bulunur. Zemin katta bir lobi, sınıf ve kütüphane vardır. X-Mansion'ın solunda, sürgülü bir kapıdan erişilen ve duvarları ve aksesuarları yeniden düzenlenerek kişiselleştirilebilen Tehlike Odası eğitim tesisi bulunur. Kayan interaktif beyaz tahta ve bir anahtarla yıkılabilen çatı gibi interaktif özelliklere sahiptir. Yetişkinler için LEGO Setleri, model yapıcılara gerçekten sürükleyici ve tatmin edici bir deneyim sunar.;

Yetişkinler için koleksiyonluk X-Men hediyesi – Bu inşa edilebilen LEGO® Marvel X-Mansion modeli, süper kahraman filmlerinin yetişkin hayranları ve deneyimli model severler için tasarlanmıştır;
Orijinal detaylar, simgeleşmiş karakterler – 10 minifigür (Wolverine, Profesör X, Jean Grey, Cyclops, Storm, Gambit, Rogue, Iceman, Bishop, Magneto) ve inşa edilebilen bir Sentinel figürü içerir;
Tatmin edici bir zorluk – Model severler, Marvel Studios'un X-Men filmlerinin önemli ve tekrar tekrar görülen bir parçasının kalıcı bir modelini inşa ederken bu büyük ölçekli projeye kendilerini kaptırabilir;
Gerçekçi aksesuarlar – X-Mansion’dan tanıdık öğeler arasında Cerebro, roketler, motorlu testereler, lazer ve Sentinel'in minifigür kısıtlama cihazı bulunur;
Yetişkin Süper Kahraman hayranları için hediye – Marvel tutkunlarına yönelik bu göz alıcı ödül, babanız, anneniz veya kendiniz dahil herhangi bir yetişkin için güzel bir hediye fikridir;
Basılı ve dijital kılavuzlar – Kaliteli, basılı yapım talimatlarının yanı sıra LEGO® Builder uygulamasında kılavuzun dijital bir sürümü de mevcuttur;
Yetişkinler için daha fazla yapım seti – Bu yaratıcı yapım seti, model inşa etmeyi seven herkese tatmin edici ve sürükleyici bir kaçış sunmak için tasarlanmış LEGO® Yetişkinler İçin Setler serisinin bir parçasıdır;
3093 parçalı yetişkin yapım seti – Tamamlanmış X-Mansion’ın yüksekliği 27 cm, genişliği 40 cm, derinliği 25 cm’dir;
;

Lego Star Wars Endor Hız Motoru Takibi Dioraması 75353
LEGO® Star Wars™ Endor Hız Motoru Takibi Dioraması (75353) ile nefes kesen bir Star Wars: Jedi’ın Dönüşü sahnesinin dinamizmini yakalayın. 3 LEGO minifigürü (Prenses Leia, Luke Skywalker ve bir Gözcü Trooper), Endor ormanlarında uçuyormuş gibi açılı bir şekilde poz verdirebileceğiniz şeffaf stantlı 2 hız motoru, inşa edilebilen 2 ağaç ve Mayıs 2023’te yeni çıkan eğrelti otları içerir. Bu yap-sergile modeli Luke Skywalker’ın (“Quick! Jam their comlinks. Center switch!”) sözlerini taşıyan bir levhayla ve Star Wars: Jedi’ın Dönüşü 40. yıl dönümü logolu bir levhayla tamamlayın. Yaratıcı maceralar galaksisi Unutulmaz sahneleri betimleyen diğer inşa edilebilen dioramalar dahil Yetişkinler için LEGO Star Wars Setleri koleksiyonunun bir parçasıdır ve kendiniz ya da başka yetişkin Star Wars hayranları için süper bir hediyedir. LEGO Builder LEGO® Builder uygulaması, yapım talimatlarınızı saklamanın ve ilerlemenizi takip etmenin yollarını, ayrıca modelleri 3 boyutlu yakınlaştırma ve döndürme araçlarını sunar;

Detaylı Endor Hız Motoru Takibi Dioraması (75353) – Star Wars: Jedi’ın Dönüşü filminden Endor ormanlarındaki ünlü hız motoru takibinin LEGO® yapım parçalarıyla inşa edilen dinamik bir sahnesini oluşturun;
3 LEGO® Star Wars™ minifigürü – Endor kıyafetli Prenses Leia ve Luke Skywalker ile bir Gözcü Trooper. Luke’un yeşil ışın kılıcı, Leia’nın ve Gözcü Trooper’ın blasteri bulunur;
Orijinal detaylar – Dinamik açılarla poz verdirmek için saydam parçalı 2 hız motoru (1 tane Leia ve Luke, 1 tanede Gözcü Trooper için), inşa edilebilen 2 ağaç, eğrelti otları ve daha fazlası;
Koleksiyonunuzu inşa edin – Bu set, ünlü Star Wars sahnelerini betimleyen, koleksiyonluk, inşa edilebilir LEGO® Star Wars™ diorama modelleri serisinin bir parçasıdır;
Yetişkinler için hediye fikri – Kendinizi ödüllendirin ya da bu 608 parçalı seti Star Wars™ meraklısı bir arkadaşa veya bir LEGO® Star Wars dioramaları koleksiyoncusuna yılbaşı ya da doğum günü hediyesi olarak verin;
Sergilemek için yapıldı – Yüksekliği 20 cm, genişliği 28 cm, derinliği 18 cm olan diorama, Star Wars: Jedi’ın Dönüşü’nün 40. yıl dönümünü kutlayan bir levhaya sahiptir;
Kolay talimatlar – LEGO® Builder uygulaması, modelleri 3 boyutlu olarak yakınlaştırmanıza ve döndürmenize, setleri kaydetmenize ve ilerlemenizi takip etmenize olanak tanıyan araçlarla yapım talimatlarını düzenli ve el altında tutmanızı sağlar;
Uzak, çok uzak bir galaksiden evinize – Yetişkinler için koleksiyonluk LEGO® Star Wars™ setleri, düşünceli ve yaratıcı bir şekilde rahatlamak için eğlenceli kendin yap projeleriyle uğraşmayı seven sizin gibi kişiler için tasarlanmıştır;
Birinci kalite – LEGO® parçaları, basit ve sağlam bir şekilde bağlanarak dayanıklı modeller oluşturmaları için titiz sektör standartlarına uygundur;
Güvenlik garantisi – LEGO® parçaları, titiz global güvenlik standartlarına uyduğundan emin olmak için düşürülür, ısıtılır, ezilir, bükülür ve analiz edilir

Lego Ninjago Hareket Kaynak Ejderhası 71822
12 yaş ve üzeri çocuklar, bu muhteşem Hareket Kaynak Ejderhası (71822) macera oyuncağıyla NINJAGO® Ejderhaların Yükselişi çizgi dizisinin 2. sezonundan hava maceralarını canlandırabilir. Şimdiye kadarki en büyük LEGO® ejderha oyuncağı olan bu modelin hareketli bacakları, kuyruğu, kalçaları, çenesi, başı, boynu ve büyük kanatları vardır. Sırtında bir eyer tahtı ve 6 küçük ruh ejderhası bulunur. Bu ejderha oyuncak seti, çocukların savaşları canlandırabilmesi için 6 minifigür içerir: ninja savaşçılar Kai, Wyldfyre ve Arin (havalı kılıç ve silah aksesuarlarıyla birlikte) ve her biri kendi silah aksesuarına sahip kötü üçlü Ras, Jordana ve Kurt Maskeli Savaşçı. Çocuklar için inşa edilebilen LEGO NINJAGO setleri ve ninja oyuncakları serisindeki robotlar, araçlar ve tapınaklarla hayranlar, kahramanları ile birlikte maceralar canlandırabilir. Her bir aksiyon oyuncağı seti, size ve çocuğunuza kolay ve sezgisel bir yapım macerasında yol gösteren LEGO Builder uygulamasıyla yapılabilir. Modelleri 3 boyutlu yakınlaştırın ve döndürün, setleri kaydedin ve ilerlemenizi takip edin.;

Çocuklar için ejderha macerası oyuncağı – 12 yaş ve üzeri erkek ve kız çocuklar, Hareket Kaynak Ejderhası ile NINJAGO® Ejderhaların Yükselişi çizgi dizisinin 2. sezonundan hava aksiyonunu canlandırabilir;
Duruşu ayarlanabilir NINJAGO® ejderha oyuncağı – Rol yapma maceraları için bu en büyük NINJAGO ejderhasının duruşu ayarlanabilir bacakları, kuyruğu, kalçaları, çenesi, başı, boynu ve büyük kanatları vardır;
Eyer tahtı – Ejderhanın sırtında, çocukların bir minifigür yerleştirerek gökyüzünde hikayeler canlandırabileceği büyük bir eyer tahtı bulunur;
6 NINJAGO® minifigürü – Ninja oyun setinde hepsi de silah aksesuarlı ninja savaşçılar Kai, Wyldfyre ve Arin, ayrıca kötü karakterler Lord Ras, Jordana ve Kurt Maskeli Savaşçı bulunur;
Çocuklar için NINJAGO® hediyesi – Bu savaş oyuncağı, eğlenceli bir yapım ve oyun deneyimi sunar ve ninja maceraları yaşamayı seven çocuklar için güzel bir doğum günü hediyesi fikridir;
Yardımcı uygulama – Model severlerin yeni beceriler kazanırken modelleri 3 boyutlu olarak yakınlaştırabileceği ve döndürebileceği, ilerlemelerini takip edebileceği ve setleri kaydedebileceği LEGO® Builder uygulamasındaki sezgisel talimatları keşfedin;
Ninja oyuncakları evreni – LEGO® NINJAGO® setleri robotlar, araçlar ve tapınaklar içerir ve çocukların ninja kahramanlarıyla birlikte macera dolu hayali bir dünyaya kaçmalarına olanak tanır;
Ölçüler – 1716 parçalı bu LEGO® setindeki büyük ejderha oyuncağının yüksekliği 39 cm, uzunluğu 63 cm, kanatları açık halde genişliği 74 cm’dir;
